import Tab from 'react-bootstrap/Tab';
import Tabs from 'react-bootstrap/Tabs'
const ProductTabs = () => {
    return (
        <ul className="nav nav-tabs" id="myTab" role="tablist" style={{marginLeft: '100px'}}>
            <li className="nav-item" role="presentation">
                <button className="nav-link active" id="home-tab" data-bs-toggle="tab" data-bs-target="#home" type="button" role="tab" aria-controls="home" aria-selected="true" style={{fontSize: '25px'}}><h1 style={{textDecoration: 'none', color: 'black'}}>Cakes</h1></button>
            </li>
            <li className="nav-item" role="presentation">
                <button className="nav-link" id="profile-tab" data-bs-toggle="tab" data-bs-target="#profile" type="button" role="tab" aria-controls="profile" aria-selected="false" style={{fontSize: '25px'}}><h1 style={{textDecoration: 'none', color: 'black'}}>Bread and Pastries</h1></button>
            </li>
        </ul>
    )
}

export default ProductTabs
